object.script:
function onTick() -- 60 ticks/s gearDownButton = input.getBool(1) frontHingeState = input.getNumber(2)
if gearDownButton then openHatch() lowerRear() lowerFront() if isFrontLowered(frontHingeState) then closeHatch() sendGearsDown() downRun = true upRun = false end else openHatch() raiseRear() raiseFront() if isFrontRaised(frontHingeState) then closeHatch() sendGearsUp() upRun = true downRun = false end end end
function openHatch() output.setNumber(1, -1) end function closeHatch() output.setNumber(1, 1) end function lowerFront() output.setNumber(2, 1) end function raiseFront() output.setNumber(2, -1) end function lowerRear() output.setNumber(3, 0) output.setNumber(4, 0) end function raiseRear() output.setNumber(3, -90) output.setNumber(4, -90) end function isFrontRaised(hingeState) if hingeState < 0 then return true else return false end end function isFrontLowered(hingeState) if hingeState > 0.2 then return true else return false end end function sendGearsDown() output.setBool(5, true) end function sendGearsUp() output.setBool(5, false) end
